import matplotlib.pyplot as plt


def plt_show(pos_track):
    x = [_[0] for _ in pos_track]
    y = [_[1] for _ in pos_track]

    # plt.plot(x, y)
    plt.figure('Scatter fig')
    ax = plt.gca()
    # 设置x轴、y轴名称
    ax.set_xlabel('x')
    ax.set_ylabel('y')
    ax.xaxis.set_ticks_position('top')
    ax.invert_yaxis()

    ax.set_ylim((160, 0))
    ax.set_xlim((0, 320))

    ax.scatter(x, y, c='r', s=5, alpha=0.5)
    plt.savefig('./pic.png')
    plt.show()


def split_track(x, y):
    x_ = [int(i) for i in x.split(',')]
    y_ = [int(i) for i in y.split(',')]
    track_list = list(zip(x_, y_))
    print(track_list)
    print(len(track_list))
    return track_list


def mean_filter(arr, step):
    """
    平滑滤波函数，输入是一个列表，输出是这个列表平滑之后的值。即取step个数的平均值
    :param arr:列表
    :param step:以多大步长取平均
    :return:平滑后的列表
    """
    new_arr = arr[:int(step / 2)]
    for kk in range(int(step / 2), len(arr) - step + int(step / 2)):
        new_arr.append(int(sum(arr[kk - int(step / 2):kk + step - int(step / 2)]) / step))
    new_arr.extend(arr[-(step - int(step / 2)):])
    return new_arr


